import React from 'react';

const mainDiv={
    height: '90vh',
    backgroundColor: '#cfcfcf',
}

class LandingPage extends React.Component{
    render(){
        return(
            <div style={mainDiv}>
                <div>
                    Hi, I'm Paridhi!
                </div>
                <div>
                    I develop websites and mobile apps. I also design! 
                </div>
            </div>
        );
    }
}

export default LandingPage;
